import './App.css';
import {Button, ButtonGroup} from "@mui/material";
import React from 'react';

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            imgdata: "data:image/png;base64, "
        };

        const thisclone = this

        let loc = window.location, new_uri;
        if (loc.protocol === "https:") {
            new_uri = "wss:";
        } else {
            new_uri = "ws:";
        }
        new_uri += "//" + loc.host;
        new_uri += loc.pathname + "api/ws";

        const ws = new WebSocket(new_uri);

        ws.onmessage = function (event) {
            // thisclone.state.imgdata = "data:image/png;base64, " + /*btoa(*/event.data/*)*/
            thisclone.setState({
                imgdata: "data:image/png;base64, " + /*btoa(*/event.data/*)*/
            })
            console.log("Updated!")
        };
    }

    handleClick = (typ, e) =>{
        switch(typ) {
            case "StartApp":
                fetch("/api/start_app")
                break;
            case "KillApp":
                fetch("/api/kill_app")
                break;
            case "Enter":
                fetch("/api/enter")
                break;
            case "TurnOffDevice":
                fetch("/api/turn_off_device")
                break;
            case "ConnectADB":
                fetch("/api/connect_adb")
                break;
            default:
        }
    };

    render () {
        return (
            <div className="App">
                <ButtonGroup style={{margin: "5px"}} variant="contained" aria-label="outlined primary button group">
                    <Button onClick={(e) => this.handleClick("KillApp", e)}>Kill App</Button>
                    <Button onClick={(e) => this.handleClick("StartApp", e)}>Start App</Button>
                    <Button onClick={(e) => this.handleClick("TurnOffDevice", e)}>Turn Off\On Device</Button>
                    <Button onClick={(e) => this.handleClick("Enter", e)}>Enter</Button>
                    <Button onClick={(e) => this.handleClick("ConnectADB", e)}>Connect ADB</Button>
                </ButtonGroup>
                <img src={this.state.imgdata} style={{width: "100%", margin: "5px"}} />
            </div>
        );
    }
}


export default App;
